import React from 'react';

const Nav = (props) => {
    return (
        <nav className="nav">
            <ul className="ul-nav">
                <li><a>Logo</a></li>
                <li><a></a></li>
                <li><a>Login</a></li>
                <li><a>Signup</a></li>
            </ul>
        </nav>
    );
}

export default Nav;
